import React from 'react';
import './addcost.css';
import {useState, useEffect} from 'react';
import LocalStorage from "./localStorage";
import AddCostPage from "./addcost";
import './report.css'

// Components from MUI lib
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Slider from '@mui/material/Slider';
import Assessment from "@mui/icons-material/Assessment";
import DeleteIcon from "@mui/icons-material/Delete";
import TableContainer from "@mui/material/TableContainer";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import TableBody from "@mui/material/TableBody";
import {styled} from "@mui/material/styles";
import TableCell, {tableCellClasses} from "@mui/material/TableCell";


//Table style configuration
const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: theme.palette.secondary,
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 16,
    },
}));
const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: '#cfd8dc',
    },
}));

const GetReportPage = () => {

    useEffect(() => {
        document.title = 'Get Report';
    }, []);

    // These state variables are used to store the values of the inputs
    const [year, setYear] = useState('');
    const [month, setMonth] = useState('');
    const [inputValues, setInputValues] = useState([]);

    //
    async function getReport(){
        if(!year || !month){
            alert("One or more missing inputs");
        }
        else{
            const report = await localStorage.getItem( 'inputValues');
            if(report)
                setInputValues(report);
            alert("Report");
        }
    }

    var index = 1;

    return (
        <div className="get-report-page">
            <h1>Cost Manager App<br/>
                Please insert the date you want to get report</h1>
            <div className="get-report-form">
                    <div className="get-report-year">
                        <label className='get-report-form-labels'>Year:</label>
                        <Stack sx={{ width: 300 }} spacing={1} direction="row">
                            <Slider
                                aria-label="year"
                                color={"secondary"}
                                aria-labelledby={'year'}
                                orientation="horizontal"
                                valueLabelDisplay="auto"
                                min={1900}
                                max={2023}
                                defaultValue={1900}
                                onChange={e => setYear(e.target.value)} required
                            />
                        </Stack>
                    </div>

                <div className="get-report-month">
                    <label className='get-report-form-labels'>Month:</label>
                    <Stack sx={{ width: 300 }} spacing={1} direction="row">
                        <Slider
                            aria-label="year"
                            color={"secondary"}
                            aria-labelledby={'year'}
                            orientation="horizontal"
                            valueLabelDisplay="auto"
                            min={1}
                            max={12}
                            defaultValue={1}
                            onChange={e => setMonth(e.target.value)} required
                        />
                    </Stack>
                </div>

                <div className="get-report-form-button">
                    <Button fullWidth='True' variant="outlined" color="secondary" endIcon={<Assessment />}
                    onClick={getReport}>Get Report
                    </Button>
                </div>
            </div>

            <div className='add-cost-form-table'>
                <TableContainer component={Paper}>
                    <Table size={'small'}  sx={{ minWidth: 700 }} aria-label="customized table">
                        <TableHead className='add-cost-form-header'>
                            <TableRow>
                                <StyledTableCell>Index</StyledTableCell>
                                <StyledTableCell align="right">Sum</StyledTableCell>
                                <StyledTableCell align="right">Category</StyledTableCell>
                                <StyledTableCell align="right">Currency</StyledTableCell>
                                <StyledTableCell align="right">Date</StyledTableCell>
                                <StyledTableCell align="right">Description</StyledTableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {inputValues.map((input) => (
                                <StyledTableRow key={input.index}>
                                    <StyledTableCell component="th" scope="row">{index++}</StyledTableCell>
                                    <StyledTableCell align="right">{input.sum}</StyledTableCell>
                                    <StyledTableCell align="right">{input.category}</StyledTableCell>
                                    <StyledTableCell align="right">{input.currency}</StyledTableCell>
                                    <StyledTableCell align="right">{input.date}</StyledTableCell>
                                    <StyledTableCell align="right">{input.description}</StyledTableCell>
                                </StyledTableRow>
                            ))}
                        </TableBody>
                    </Table>
                </TableContainer>
            </div>
        </div>
    );
}

export default GetReportPage;
